    "Latex_2": {
        "Origin": "기역. 에프엑스는 엑스의 세제곱 더하기 삼엑스제곱 더하기 삼엑스"
    },
    "Latex_3": {
        "Origin": "\n기역. 쥐엑스는 [삼 분의 일] 엑스의 세제곱 빼기 이엑스제곱 더하기 오엑스 더하기 사",
        "Frac_list": {
            "[FRAC 1]": "삼 분의 일  "
        }
    },
    "Latex_4": {
        "Origin": "디. 에이치엑스는 이엑스세제곱 더하기 육엑스제곱 빼기 십팔엑스 더하기 일"
    }
}

